import Link from "next/link";

const Home = (props) => (
  <ul>
    <li>
      <Link href="/b" as="/a">
        <a>a</a>
      </Link>
      {props.porcodio}
    </li>
    <li>
      <Link href="/a" as="/b">
        <a>b</a>
      </Link>
    </li>
  </ul>
);

Home.getInitialProps = async ({ context }) => {
  console.log(context.query);
  return {
    porcodio: "dio scatenatissimo animale da sagra",
  };
};

export default Home;
